import React from 'react';
import LogoSvg from '../../assets/logo.svg';

import { 
    Container, 
    Header,
    LogImg
} from './styles';

const Aside: React.FC = () => {
    return (
        <Container>
            <Header>
               <LogImg img src = {LogoSvg} alt="logo"/>
            </Header>
        </Container>
    );
}

export default Aside;
